import React, { Component} from 'react'
import '../Styling/global.css';
import '../Styling/final_questionnaire.css';

import classnames from 'classnames';
import styles from '../Styling/Final.module.css'
import * as Survey from "survey-react";
import {addFinal} from "../Utils/API";
import {addInteraction} from '../Utils/API'



export default class FinalOpenness extends Component{
    constructor(props){
        super(props);

        this.goToNext = this.goToNext.bind(this);
    }


    goToNext(survey){
        const data = survey.data;
        const userId = localStorage.getItem('userId');
        const openness = localStorage.getItem('openness');
        addFinal(userId, openness, data);
        addInteraction(userId, openness, -1, 'goToThanks', 'click', 1);
        this.props.history.push({
            pathname: '/Thanks',
        })


    }


    render(){
        const styleContainer = classnames('container-rows', styles.container);
        const styleDivSurvey = classnames(styles.divSurvey);
        var surveyJSON = {"pages":[{"name":"page1","elements":[{"type":"image","name":"image","imageLink":"data:image/png;base64,","imageWidth":600},
            {"type":"radiogroup","name":"question1","title":"I prefer to see the information about a song (see" +
            " picture above)...","isRequired":true,"choices":[{"value":"item1","text":"only in the form of bars"},{"value":"item2","text":"in a combination with bars, text, representation of the total fit and a scatter plot"}]},
            {"type":"checkbox","name":"question2","title":"If you would be able to select the information sources yourself, you would select... (multiple options possible)","isRequired":true,"choices":[{"value":"item1","text":"Bars"},{"value":"item2","text":"Text about the total fit"},{"value":"item3","text":"Text about the similar song"},{"value":"item5","text":"Cover of the similar song"},{"value":"item4","text":"Scatter plot"}]},
            {"type":"text","name":"question3","title":"Why would you select these information source(s)?","isRequired":true},{"type":"text","name":"question4","title":"Did you run into technical difficulties? If yes, which ones?","isRequired":true},{"type":"text","name":"question5","title":"Any other comment?"}]}]}




        return(
            <div
                className={styleContainer}
            >
                <div
                    className={styleDivSurvey}
                >
                    <Survey.Survey json={ surveyJSON } onComplete={ this.goToNext } />
                </div>
            </div>

        );
    }
}



